import React from 'react';

function Posts({posts,liked}) {

  return <div>
      {posts.map((p)=>
          <>
          <h3>{p.text}</h3>
          <button onClick={liked()}>{p.likes}</button>
          </>
          )}
  </div>;
}

export default Posts;
